import React, { useState } from 'react';
import { 
  Box, 
  Button, 
  TextField, 
  Typography, 
  Grid, 
  Paper, 
  CircularProgress,
  FormControl,
  InputLabel,
  Select,
  MenuItem
} from '@mui/material';
import { generateAds } from '../../services/api';
import '../../styles/AdGeneration.css';

const GenerateAd = () => {
  const [adType, setAdType] = useState('image');
  const [description, setDescription] = useState('');
  const [adPurpose, setAdPurpose] = useState('');
  const [targetAudience, setTargetAudience] = useState('');
  const [loading, setLoading] = useState(false);
  const [adOptions, setAdOptions] = useState([]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      const response = await generateAds({
        ad_format: adType,
        description,
        advertisement_goals: adPurpose,
        target_audience: targetAudience
      });

      setAdOptions(response.options || []);
    } catch (error) {
      console.error('Error generating ad:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h5" gutterBottom>
        Generate Advertisement
      </Typography>

      <Paper elevation={3} sx={{ p: 3, mb: 4 }}>
        <form onSubmit={handleSubmit}>
          <Grid container spacing={3}>
            {/* Remove text ad option, only keep image and video */}
            <Grid item xs={12}>
              <FormControl fullWidth>
                <InputLabel>Advertisement Type</InputLabel>
                <Select
                  value={adType}
                  label="Advertisement Type"
                  onChange={(e) => setAdType(e.target.value)}
                >
                  {/* Remove the text option */}
                  <MenuItem value="image">Image Advertisement</MenuItem>
                  <MenuItem value="video">Video Advertisement</MenuItem>
                </Select>
              </FormControl>
            </Grid>

            <Grid item xs={12}>
              <TextField
                fullWidth
                label="Business/Product Description"
                multiline
                rows={4}
                value={description}
                onChange={(e) => setDescription(e.target.value)}
                required
              />
            </Grid>

            <Grid item xs={12}>
              <TextField
                fullWidth
                label="Advertisement Purpose"
                multiline
                rows={3}
                value={adPurpose}
                onChange={(e) => setAdPurpose(e.target.value)}
                required
              />
            </Grid>

            <Grid item xs={12}>
              <TextField
                fullWidth
                label="Target Audience"
                multiline
                rows={3}
                value={targetAudience}
                onChange={(e) => setTargetAudience(e.target.value)}
                required
              />
            </Grid>

            <Grid item xs={12}>
              <Button
                type="submit"
                variant="contained"
                color="primary"
                fullWidth
                disabled={loading}
                sx={{ py: 1.5 }}
              >
                {loading ? <CircularProgress size={24} /> : 'Generate Advertisement'}
              </Button>
            </Grid>
          </Grid>
        </form>
      </Paper>

      {adOptions.length > 0 && (
        <Box className="ad-options-container">
          <Typography variant="h5" gutterBottom>
            Generated Options
          </Typography>

          {adOptions.map((option, index) => (
            <Paper 
              key={index} 
              elevation={3} 
              className="ad-option"
            >
              <Typography variant="h6" gutterBottom>
                Option {index + 1}
              </Typography>
              <div>{option}</div>
            </Paper>
          ))}
        </Box>
      )}
    </Box>
  );
};

export default GenerateAd;
